import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhone } from '@fortawesome/free-solid-svg-icons';
import {
  Nav,
  Navbar,
  NavbarToggler,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarBrand,
  Collapse
} from 'reactstrap';
import Logo from './Logo';

class CustomNavbar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <nav className="fixed-top">
        <Navbar color="faded" light expand="md">
          <Nav className="topNav navbar navbar-light row align-items-start">
            <div className="order-2 order-md-1 col-12 col-md-6 d-flex justify-content-center justify-content-md-start">
              <Logo />
            </div>
            <div className="order-1 order-md-2 col-12 col-md-6 d-flex flex-nowrap justify-content-center justify-content-md-end">
              <a
                href="tel:+1561-264-1245"
                className="btn btn-primary topNavBtn"
              >
                <FontAwesomeIcon icon={faPhone} /> (561) 264-1245
              </a>
              <Link
                exact
                to="/request-appointment"
                className="btn btn-outline-primary topNavBtn"
              >
                Request an Appointment
              </Link>
            </div>
          </Nav>
        </Navbar>
        <Navbar color="faded" light expand="md">
          {/* Brandname */}
          <NavbarBrand href="/">Demo</NavbarBrand>
          {/* Add toggler to auto-collapse */}
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            {/*Pull left */}
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/link/">Left Nav Link</NavLink>
              </NavItem>
            </Nav>

            {/* Pull right */}
            <Nav className="mr-auto" navbar>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Bob
                </DropdownToggle>

                <DropdownMenu>
                  <DropdownItem>Account</DropdownItem>
                  <DropdownItem>Settings</DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>Logout</DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
      </nav>
    );
  }
}

export default CustomNavbar;
